import React, { Component } from "react";
import "./acquire.css";
import Button from "../../../../ui/button/button";
import SearchResult from "./searchresult";
import { Route } from "react-router-dom";
class Acquire extends Component {
  render() {
    return (
      <div>
        <Button
          btnType="primary"
          style={{ float: "left" }}
          clicked={this.props.togglePages}
        >
          Back To Acquisitions
        </Button>
        <div className="clr" style={{ marginBottom: "0.75rem" }}></div>
        <div className="search-area">
          <input
            type="text"
            placeholder="Enter Title"
            onChange={this.props.handleSearch}
            value={this.props.value}
          />
          <Button btnType="fill" clicked={this.props.scrapeBooks}>
            Scrape
          </Button>
        </div>
        <Route
          path={this.props.match.path + "/results"}
          render={() => <SearchResult books={this.props.books} />}
        />
      </div>
    );
  }
}

export default acquire;
